@nikitalavretski asked me to make an instant film inspired by Belarusian “weird news stories”. 

Budget: pizza.

@brianbell @craigstark_ @strattosphere94 starred with me. Made in one night.

Music by @ethangold . Edited by Jack Sweeney. Co-producer Haley Adams.

“I Love Me” will be premiere as part of a feature film comprised of 20 stories, all inspired by a weekly column of “weird true news items” from Minsk, Belarus. Premiering at in June.

